@daniel__db האח הגדול פעם: יום בשבוע
האח הגדול היום: כל יום
@GevaLamar

@moshe_tsach אתה מה זה טועה 
אחרי הבחירות כולם באגף הבוגדים בשדה תימן. עם הנכס שלהם הנוחבות. שידור חי מתמשך בערוץ האח הגדול . 
יהיה נס

@CaspiJonathan @historyinpic9 לא לא.
שם לפחות יש נרטיב , יש בריף.
האח הגדול זה השיא. אין שם כלום. ניסוי שבו הצופים הם המושא והמטרה היא להוכיח שאם זה בטלוויזיה- אנשים יצפו, ממש כמו שג׳ורג׳ מסיינפלד הסביר. והכי מזעזע - הניסוי מצליח. https://t.co/3R5F0yHLXG

@Avigdorii אז מה נגיד על כל הממשלה הזו?? על שר הבטחון, שר בטחון הפנים, שר החינוך, שרת התחבורה ושר המשפטים... ואפשר להמשיך.
בכל דבר שנגעו או לא נגעו נכשלו כישלון אדיר אבל העם המטומטם שלנו, הפראייר והדביל לא עושה כלום. רואה האח הגדול בזמן שבניו נהרגים והחטופים מעונים.
עם מפגר

@nir_ אני בעד להפוך אותם
 לתכנית האח הגדול 

חודש על הסירה עם כמה אנשי חמאס ולראות איך עובד דו קיום
